import React from 'react'

const Home = () => {
    return (
        <div className="mb-20">
            <h1 className="sm:text-4xl text-2xl font-bold mt-6 mb-6 text-gray-900">Hello peeps!</h1>
            <p className="mx-auto leading-relaxed text-base mb-4">Do you prefer to work as part of a team or independently?</p>
            <p className="mx-auto leading-relaxed text-base mb-4">Do you enjoy working in a team environment?</p>
            <p className="mx-auto leading-relaxed text-base mb-4">So, this blog is about me. I'm Sairam Nomula, 19 years old, I'm from Khammam. I am pursuing my bachelors in Computer Science and Engineering specialized in Software Engineering at SRM University, Kattankulathur.</p>

            <p>Coming together is a beginning, staying together is progress, and working together is success.</p>
            
        </div>
    )
}

export default Home
